- input: "TEXT\x1CC00488742\x1C1\x1C\x1CF3XA\x1C1/15/13:  This is in response to your
    letter dated 1/02/2013 requesting clarification of the information in our amended
    September 2012 monthly report on 10/17/2012 regarding certain activity not disclosed
    on our original September 2012 Monthly report.  We amended the original September
    2012 monthly report to update Line 11a to disclose a receipt from the National
    Association of Realtors (See 10/18/2012 Amendment explanation below).  This contribution
    was made on the last day of August, 2012, and, simply put, was inadvertently left
    off the original September monthly report covering the period of 08/01/2012 to
    8/31/2012.  The September 2012 monthly report was also amended to update line
    21b for to include disbursements also inadvertently omitted from the September
    2012 monthly report (but also included in 10/18/2012 Amendment explanation below).
    \ Note that these disbursements represent advance polling costs paid to Peter
    D. Hart, Public Opinion Strategies, LLC and the Tarrance Group in connection with
    independent expenditures that were not publicly disseminated during the report
    period, but that were disseminated and reported as independent expenditures in
    subsequent reporting periods.  Previous explanation on report filed 10/18/2012:
    \ We are amending our September 2012 Monthly report to update Line 11a receipts
    with a receipt from National Association of Realtors on 8/31/2012 and also update
    Line 21b with advance payments for Independent expenditures not disseminated in
    this reporting period but in future reporting periods. For Line 21b of this report,
    the 8/17/12 disbursements to Peter D Hart, Public Opinion Strategies LLC, & The
    Tarrance Group represent advance costs for Independent Expenditures that were
    not publicly disseminated during the reporting period, but will be disseminated
    in future reporting periods. \n"
